import React from 'react';

interface ActivityItemProps {
  type: string;
  content: string;
  time: string;
}

const MobileRecentActivityItem: React.FC<ActivityItemProps> = ({ type, content, time }) => {
  return (
    <div className="text-center">
      <p className="mb-0">{type}</p>
      <p className="mb-0">{type === '♡' ? 'Liked' : type === '→' ? 'Followed' : 'Played'}</p>
      <p className="small font-italic">{content}</p>
      <p className="small text-muted">{time}</p>
    </div>
  );
};

export default MobileRecentActivityItem;
